import React, { useState } from 'react';
import Ho from './Home.module.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';
import { faAddressCard } from '@fortawesome/free-solid-svg-icons';
import { faUser } from '@fortawesome/free-solid-svg-icons';
import { faPhoneVolume } from '@fortawesome/free-solid-svg-icons';

function Home() {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const sidebarStyle = {
    display: isSidebarOpen ? 'block' : 'none',
  };

  return (
    <div className={Ho.main}>
       <button className={Ho.d} onClick={toggleSidebar}>
            &#9776;  
          </button>
      <div style={sidebarStyle} className={`${Ho.sidebar} ${Ho.open}`}>
        <div className={Ho.navbar}>
          <h1>Todo List</h1>
          <nav>
            <a><FontAwesomeIcon className={Ho.icn1} icon={faHouse} /> Home</a>
            <a><FontAwesomeIcon className={Ho.icn1} icon={faAddressCard} /> Feedback Form</a>
            <a><FontAwesomeIcon className={Ho.icn1} icon={faUser} /> Login/Signup</a>
            <a><FontAwesomeIcon className={Ho.icn1} icon={faPhoneVolume} /> Contact Us</a>
          </nav>
        </div>
      </div>
    </div>
  );
}

export default Home;
